content:
엄마가 저렇게 양육 해놓고 세상 탓이라니;;

만화를 보기를 했나;;

어디 정상적으로 양육이 가능하냐?

세상 탓 안하게 생겼니?

아니 근데 만화적 설정으로 &quot;인육밖에 못먹음&quot;
이런거면 어쩔수없는데
인육이나 동물이나 뭐가 다른거지;
익힌걸 못먹고 생것밖에 못먹는건가?
동물은 기생충땜에 생걸론 못먹고?

헐 마지막 소름........
근데 누구의 아이인가....?;ㅅ;
궁금한게 아직 많다

엄마로서 한 행동이라지만 그게 너무 과했다.
저 주교도 제정신 아니고;;;;
미겔이 그래도 사람을 잡아먹는 비정상적인 사람이지만, 등장인물 중에 가장 정상적으로 생각하는 것 같다.

마지막에 바토리 부인 돌아볼 때,
 .
칼 들어서 주교 한방에 죽일 줄 ;

뭐지   이변태같은   설정은??
옷은   입히고   때리던가
ㅡㅡ;;;;

솔직히 드라마나 다른 웹툰 보다가 잘생긴 남자가 웃통벗는장면이나 목욕씬 등으로 노출하면 &#x27;어멋 눈호강!&#x27;
하면서 왜 여성 서비스컷에는 유독 발끈하는지 모르겠다.
어짜피 시작부터 비정상적인 설정의 픽션을 보고있지 않았나? 우리나라가 남녀 불평등이 심한건 아는데 이런 서비스컷은 위 비유한 &#x27;어멋 눈호강&#x27; 상황과 전혀 다른 상황이 아니다.

메갈쿵쾅이라고 귀막고있는것들은 어떻게 살어가는겨 
작가가 충격을 위해소 저런컷을 넣은거라고 생각하고 웹툰 봤는데 
먼저댓글에 몸매니 서비스컷이니지랄허니까 그러지 ;;

솔직히 좀....;;;
잔이랑 잘될때는 오?벌써?이러면서도 좋았는데
이번엔 아멜리랑 좀 잘되나 싶었는데 또 이렇게;;
미겔도 좀 행복하게해주세요ㅡㅡ
